import React, { FC } from 'react'
import { RootState } from '../../../store/store'
import { useDispatch, useSelector } from 'react-redux'
import Input from '../../UI/Input'
import { useFindAllOrder, useFindUser } from '../../../hooks'
import { emailChange, phoneChange } from '../../../store/historySlice'
import { validateFormaHistory } from './validatorFormaHistory'





const FormHistory: FC = () => {
  const { findOneUser } = useFindUser()
  const { findAllOrder } = useFindAllOrder()
  const dispatch = useDispatch() 
  const email:string = useSelector((state: RootState) => state.history.email)
  const phone : string = useSelector((state: RootState) => state.history.phone)


